import React from "react";

import { Button, Input } from "@rneui/themed";

import { StyleSheet, View, KeyboardAvoidingView } from "react-native";

const numColumns = 2;

class PageheaderNoSearch extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <View
        style={{
          flex: 0.18,
          flexDirection: "column",
          backgroundColor: "#CAC4CE",
        }}
      >
        <View style={{ flex: 0.9, backgroundColor: "#CAC4CE" }}>
          <View //Dette er samlingen af knapper
            style={[
              styles.buttonGroup,
              {
                flexDirection: "row",
              },
            ]}
          >
            <View style={{ flex: 1, margin: 5 }}>
              <Button
                color={this.props.activePage === 0 ? "#D17B0F" : "#242038"}
                buttonStyle={{
                  borderRadius: 8,
                  fontSize: 17,
                  minHeight: 41,
                }}
                onPress={() => this.props.navigation.navigate("Homepage")}
                title="Boardgames"
                titleStyle={{
                  fontWeight: "700",
                  fontSize: 17,
                  color: "#F7ECE1",
                }}
              />
            </View>
            <View //Dette er samlingen af navbuttons
              style={{ flex: 1, margin: 5 }}
            >
              <Button
                color={this.props.activePage === 1 ? "#D17B0F" : "#242038"}
                buttonStyle={{
                  borderRadius: 8,
                  minHeight: 41,
                }}
                onPress={() => this.props.navigation.navigate("Playgroups")}
                title="Playgroups"
                titleStyle={{
                  fontWeight: "700",
                  fontSize: 17,
                  color: "#F7ECE1",
                }}
              />
            </View>
            <View style={{ flex: 1, margin: 5 }}>
              <Button
                color={this.props.activePage === 2 ? "#D17B0F" : "#242038"}
                buttonStyle={{
                  borderRadius: 8,
                  minHeight: 41,
                }}
                onPress={() => this.props.navigation.navigate("Ranking")}
                title="Ranking"
                titleStyle={{
                  fontWeight: "700",
                  fontSize: 17,
                  color: "#F7ECE1",
                }}
              />
            </View>
          </View>
        </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  buttonGroup: {
    flex: 1,
    paddingTop: 10,
    height: 50,
    minHeight: 50,
    backgroundColor: "#CAC4CE",
  },
  itemText: {
    color: "#F7ECE1",
    fontWeight: "700",
    fontSize: 17,
  },
});

export default PageheaderNoSearch;
